#include <iostream>
#include <vector>
#include <map>
#include <utility>
#include <algorithm>
#include <unordered_set>

using namespace std;


class Solution {
public:
    struct pair_hash {
        inline size_t operator()(const pair<int, int>& p) const {
            const auto h1 = hash<int>()(p.first);
            const auto h2 = hash<int>()(p.second);
            return h1 ^ (h2 << 1);
        }
    };

    vector<vector<int>> threeSum1(const vector<int>& nums) {
        multimap<int, int> remainMap;
        for (size_t i = 0; i < nums.size(); i++) {
            remainMap.insert(make_pair(nums[i], i));
        }

        unordered_set<pair<int, int>, pair_hash> buffer;
        vector<vector<int>> ret;
        for (size_t i = 0; i < nums.size() - 1; i++) {
            for (size_t j = i + 1; j < nums.size(); j++) {
                const auto iandj = make_pair(nums[i], nums[j]);
                if (buffer.find(iandj) != cend(buffer)) { continue; }
                const auto remain = 0 - (nums[i] + nums[j]);
                const auto& [begin, end] = remainMap.equal_range(remain);
                if (begin != end) {
                    if (any_of(begin, end,
                        [&](const auto& x) {
                            return (j < x.second) &&
                                (buffer.find(make_pair(nums[i], x.first)) == cend(buffer)) &&
                                (buffer.find(make_pair(nums[j], x.first)) == cend(buffer));
                        })) {
                        buffer.emplace(iandj);
                        ret.emplace_back(vector<int>{nums[i], nums[j], remain, });
                    }
                }
            }
        }
        return ret;
    }

    vector<vector<int>> threeSum(vector<int>& nums) {
        
        sort(begin(nums), end(nums));


        if(3 < nums.size()){
            vector<int> temp;
            temp.emplace_back(nums[0]);
            temp.emplace_back(nums[1]);
            temp.emplace_back(nums[2]);
            for (int index = 3; index < nums.size(); index++) {
                if (nums[index - 3] != nums[index]) {
                    temp.emplace_back(nums[index]);
                }
            }
            return threeSum1(temp);
        }
        else {
            return threeSum1(nums);
        }
    }
};


void test(vector<int>&& nums) {
    const auto ret = Solution().threeSum(nums);

    for (auto&& list : ret) {
        for (auto&& val : list) {
            std::cout << val << ",";
        }
        std::cout << std::endl;
    }
    std::cout << std::endl;
}

